INSERT INTO `t_log` VALUES (1088, 'MrBird', '修改Question', 135, 'cc.mrbird.febs.exercise.controller.QuestionController.updateQuestion()', ' question: Question(questionId=5, questionTitle=测试代码, questionContent=<span>为什么学习JavaScript</span><p><span><strong>一、你知道，为什么JavaScript非常值得我们学习吗？</strong></span><br><span>1. 所有主流浏览器都支持JavaScript。</span><br><span>2. 目前，全世界大部分网页都使用JavaScript。</span><br><span>3. 它可以让网页呈现各种动态效果。</span><br><span>4. 做为一个Web开发师，如果你想提供漂亮的网页、令用户满意的上网体验，JavaScript是必不可少的工具。</span></p><p><br><span>二、<strong>易学性</strong></span><br><span>1.学习环境无外不在，只要有文本编辑器，就能编写JavaScript程序。</span><br><span>2.我们可以用简单命令，完成一些基本操作。</span></p><p><br><span><strong>三、从哪开始学习呢？</strong></span><br><span>学习JavaScript的起点就是处理网页，所以我们先学习基础语法和如何使用DOM进行简单操作。</span>你好，<strong>世界!</strong></p><pre><code><span>class</span><span>attention_layers</span><span>(</span><span>Layer</span><span>):</span><br><span>def</span><span>__init__</span><span>(</span><span>self</span><span>,</span><span>**</span>kwargs<span>):</span><br><span>super</span><span>(</span>attention_layers<span>,</span><span>self</span><span>).</span>__init__<span>(</span><span>**</span>kwargs<span>)</span><br><br><span>def</span><span>build</span><span>(</span><span>self</span><span>,</span>inputshape<span>):</span><br>        assert len<span>(</span>inputshape<span>)</span><span>==</span><span>3</span><br><span>#以下是keras的自己开发工作</span><br><span>self</span><span>.</span><span>W</span><span>=</span><span>self</span><span>.</span>add_weight<span>(</span>name<span>=</span><span>\'attr_weight\'</span><span>,</span><br>                                 shape<span>=</span><span>(</span>inputshape<span>[</span><span>1</span><span>],</span> inputshape<span>[</span><span>2</span><span>]),</span><br>                                 initializer<span>=</span><span>\'uniform\'</span><span>,</span><br>                                 trainable<span>=</span><span>True</span><span>)</span><br><span>self</span><span>.</span>b<span>=</span><span>self</span><span>.</span>add_weight<span>(</span>name<span>=</span><span>\'attr_bias\'</span><span>,</span><br>                                 shape<span>=</span><span>(</span>inputshape<span>[</span><span>1</span><span>],),</span><br>                                 initializer<span>=</span><span>\'uniform\'</span><span>,</span><br>                                 trainable<span>=</span><span>True</span><span>)</span><br><span>super</span><span>(</span>attention_layers<span>,</span><span>self</span><span>).</span>bulid<span>(</span>inputshape<span>)</span><br><br><span>def</span><span>call</span><span>(</span><span>self</span><span>,</span>inputs<span>):</span><br>        x<span>=</span><span>K</span><span>.</span>permute_dimensions<span>(</span>inputs<span>,</span><span>(</span><span>0</span><span>,</span><span>2</span><span>,</span><span>1</span><span>))</span><br>        a<span>=</span><span>K</span><span>.</span>softmax<span>(</span><span>K</span><span>.</span>tanh<span>(</span><span>K</span><span>.</span>dot<span>(</span>x<span>,</span><span>self</span><span>.</span><span>W</span><span>)</span><span>+</span><span>self</span><span>.</span>b<span>))</span><br>        outputs<span>=</span><span>K</span><span>.</span>permute_dimensions<span>(</span>a<span>*</span>x<span>,</span><span>(</span><span>0</span><span>,</span><span>2</span><span>,</span><span>1</span><span>))</span><br>        outputs<span>=</span><span>K</span><span>.</span>sum<span>(</span>outputs<span>,</span> axis<span>=</span><span>1</span><span>)</span><br><span>return</span>  outputs<br><br><span>def</span><span>compute_output_shape</span><span>(</span><span>self</span><span>,</span> input_shape<span>):</span><br><span>return</span> input_shape<span>[</span><span>0</span><span>],</span> input_shape<span>[</span><span>2</span><span>]</span></code></pre>, questionStart=2021-02-20 00:00:00, questionEnd=2021-02-20 00:17:34, questionResult=1212123, questionResultType=1, questionCreateUser=null, createTime=null, modifyTime=null, questionIsDelete=null, deleteTime=null)', '192.168.1.75', '2021-02-20 00:46:51', NULL);
