<span>self</span><span>.</span>add_weight<span>(</span>name<span>=</span><span>\'attr_bias\'</span><span>,</span><br>                                 shape<span>=</span><span>(</span>inputshape<span>[</span><span>1</span><span>],),</span><br>                                 initializer<span>=</span><span>\'uniform\'</span><span>,</span><br>                                 trainable<span>=</span><span>True</span><span>)</span><br><span>super</span><span>(</span>attention_layers<span>,</span><span>self</span><span>).</span>bulid<span>(</span>inputshape<span>)</span><br><br><span>def</span><span>call</span><span>(</span><span>self</span><span>,</span>inputs<span>):</span><br>        x<span>=</span><span>K</span><span>.</span>permute_dimensions<span>(</span>inputs<span>,</span><span>(</span><span>0</span><span>,</span><span>2</span><span>,</span><span>1</span><span>))</span><br>        a<span>=</span><span>K</span><span>.</span>softmax<span>(</span><span>K</span><span>.</span>tanh<span>(</span><span>K</span><span>.</span>dot<span>(</span>x<span>,</span><span>self</span><span>.</span><span>W</span><span>)</span><span>+</span><span>self</span><span>.</span>b<span>))</span><br>        outputs<span>=</span><span>K</span><span>.</span>permute_dimensions<span>(</span>a<span>*</span>x<span>,</span><span>(</span><span>0</span><span>,</span><span>2</span><span>,</span><span>1</span><span>))</span><br>        outputs<span>=</span><span>K</span><span>.</span>sum<span>(</span>outputs<span>,</span> axis<span>=</span><span>1</span><span>)</span><br><span>return</span>  outputs<br><br><span>def</span><span>compute_output_shape</span><span>(</span><span>self</span><span>,</span> input_shape<span>):</span><br><span>return</span> input_shape<span>[</span><span>0</span><span>],</span> input_shape<span>[</span><span>2</span><span>]</span></code></pre>, questionStart=2021-02-20 00:00:00, questionEnd=2021-02-20 00:17:34, questionResult=1212123, questionResultType=1, questionCreateUser=null, 