INSERT INTO `t_log` VALUES (1099, 'MrBird', '修改Question', 98, 'cc.mrbird.febs.exercise.controller.QuestionController.updateQuestion()', ' question: Question(questionId=6, chapterId=188, questionTitle=测试实验2, questionContent=<blockquote>争做国内使用体验Z好的开源 Web 富文本编辑器！</blockquote>为何选择 wangEditor<ul><li>万星项目&nbsp;<a href=\"https://github.com/wangeditor-team/wangEditor/releases\" rel=\"nofollow\">Github Star 1w+</a></li><li>简洁、轻量级、<a href=\"https://doc.wangeditor.com/\" rel=\"nofollow\">文档</a>齐全</li><li>QQ 群及时答疑</li><li><a href=\"https://doc.wangeditor.com/#%E5%BC%80%E5%8F%91%E4%BA%BA%E5%91%98\" rel=\"nofollow\">开源团队</a>维护，非个人单兵作战</li></ul>初见<p>npm 安装&nbsp;<code>npm i wangeditor --save</code>&nbsp;，几行代码即可创建一个编辑器。</p><pre><code>import E from \'wangeditor\'\nconst editor = new E(\'#div1\')\neditor.create()</code></pre><p>更多使用配置，请阅读<a href=\"https://doc.wangeditor.com/\" rel=\"nofollow\">使用文档</a>。</p>demo<p>在线体验 demo 可到&nbsp;<a href=\"https://codepen.io/collection/DNmPQV\" rel=\"nofollow\">codepen.io/collection/DNmPQV</a>&nbsp;。</p><p>注意，如果打不开，可以去查看&nbsp;<a href=\"https://github.com/wangeditor-team/wangEditor/tree/master/examples\" rel=\"nofollow\">github examples</a>&nbsp;的源码。</p>浏览器兼容性<ul><li>兼容主流 PC 浏览器，IE11+</li><li>不支持移动端和 ipad</li></ul>遇到问题<ul><li>加入 QQ 群：901247714(人已满)，164999061(人已满)，710646022</li><li><a href=\"https://github.com/wangeditor-team/wangEditor/issues\" rel=\"nofollow\">提交问题和建议</a></li></ul>贡献代码<p>欢迎非团队成员贡献代码，提交 Pull Request，请一定参考<a href=\"https://github.com/wangeditor-team/wangEditor/blob/master/docs/contribution.md\" rel=\"nofollow\">贡献代码流程</a>。</p>谁在维护<p>wangEditor 现有一个开源团队在维护，团队可以保证答疑、bug 修复和迭代效率。</p><p><a href=\"https://doc.wangeditor.com/#%E5%BC%80%E5%8F%91%E4%BA%BA%E5%91%98\" rel=\"nofollow\">查看开发团队，或想加入开发团队</a></p>为我们点赞<p>如果你感觉有收获，欢迎给我打赏，以激励我们更多输出优质开源内容。</p><p><img src=\"https://www.wangeditor.com/imgs/ali-pay.jpeg\">&nbsp;<img src=\"https://www.wangeditor.com/imgs/wechat-pay.jpeg\"></p>, questionStart=2021-02-20 00:00:00, questionEnd=2021-02-20 00:50: