INSERT INTO `t_log` VALUES (1103, 'MrBird', '新增Question', 138, 'cc.mrbird.febs.exercise.controller.QuestionController.addQuestion()', ' question: Question(questionId=9, chapterId=191, questionTitle=测试4, questionContent=<p>2.3 拟采用的技术措施和办法</p><p>针对融入实体类型与关系类型约束的知识图谱表示学习模型的研究，本课题的研究工作有两个：（1）融入实体类型与关系类型约束的表示学习方法；（2）融入实体类型与关系类型约束的表示学习方法的优化。</p><p>2.3.1 融入实体类型与关系类型约束的表示学习方法研究</p><p>其研究内容如下：</p><p>（1）研究融入实体类型rdf:type的模型方法</p><p>（2）研究如何计算实体对于不同类型的权重大小</p><p>（3）研究如何融入关系类型约束rdfs:domain和rdfs:range</p><p>对应研究方法如下：</p><p>（1）采用数学中的球状结构建模实体类型rdf:type</p><p>（2）数据特征与attention机制融合计算类型的偏重信息，偏重信息表达为实体向量到球心的距离</p><p>（3）使用神经网络提取实体rdfs:domain与rdfs:range隐藏特征表示来融入关系类型约束</p><p>其详细的技术路线如下图。</p><p>图2. 工作一详细技术路线</p><p>与技术路线相对应，本课题首先确定本课题进行研究采用的数据信息。本课题拟采用的评测数据集包括：①带有类型信息的通用表示学习基准测试集FB15K<sup>[16]</sup>和②YAGO39K和M-YAGO39K<sup>[20]</sup>。这些数据集满足了实验所需要的数据特征，以FB15K中的William Shakespeare实体为例：</p>, questionStart=2021-02-20 23:16:51, questionEnd=2021-02-20 23:16:52, questionResult=12121212, questionResultType=1, questionCreateUser=1, createTime=Sat Feb 20 23:16:58 CST 2021, modifyTime=null, questionIsDelete=null, deleteTime=null, chapterName=null, createName=null)', '192.168.1.10', '2021-02-20 23:16:58', '内网IP|0|0|内网IP|内网IP');
