INSERT INTO `t_log` VALUES (1112, 'MrBird', '新增Question', 137, 'cc.mrbird.febs.exercise.controller.QuestionController.addQuestion()', ' question: Question(questionId=11, chapterId=199, questionTitle=计算原理导论例题, questionContent=<br><p><b>CS4HS pedagogy breakout</b>:</p><ul><li>Pre: intimidate by computers, jargon/errors are a wall</li><li>Post: see the essential ideas, maybe pique interest</li><li>Strategy: use code, but make it easy, show relevance/power</li></ul><p>This class explores the essential qualities of computers, how they work, what they can and cannot do, and requires not computer background at all. In this first section we\'ll look at the basic features of computers and get started playing with computer code.</p><p>Acknowledgement: thanks to Google for supporting my early research that has helped create this class.</p>Fundamental Equation of Computers<p>The fundamental equation of computers is:</p><p>&nbsp;&nbsp;Computer = Powerful + Stupid</p><ul><li>Powerful -- looking through masses of a data<br>--Billions of \"operations\" per second</li><li>Stupid<br>--Operations are simple and mechanical<br>--Lacks \"insight\"</li><li>Powerful + Stupid quality ... see in code experiments</li><li>The computer world has this funny, mechanical quality</li><li>But computers still are incredibly useful</li><li>That\'s what this class is about<br>--Visit this funny computer world, see how it works<br>--Understand what they can do<br>--Not intimidated, computer is not a magic box</li><li>Hidden agenda: too few CS people<br>--Open your eyes computer world .. some students interested more computer science</li></ul><ul><li>Computers are very powerful, looking through large amounts of data quickly. Computers can literally perform billions of operations per second.</li><li>However, the individual \"operations\" that computers can perform are extremely simple and mechanical, nothing like a human thought or insight. A typical operation in the language of computers is adding two numbers together.</li><li>So although the computers are fast at what they do, the operations that they can do are extremely rigid, simple, and mechanical. The computer lacks anything like real insight. Or put another way, computers are&nbsp;<b>not</b>&nbsp;like the HAL 9000 from the movie 2001: A Space Odyssey:&nbsp;<a href=\"http://www.youtube.com/watch?v=HwBmPiOmEGQ#t=31s\" rel=\"nofollow\">HAL 9000 youtube clip</a></li><li>If nothing else, you should not be intimidated by the computer as if it\'s some sort of brain. The computer is a mechanical tool which can do amazing things, but it requires a human to tell it what to do.</li></ul>First Approximation - How Does a Computer Work?<ul><li>Computer is driven by \"code\" (more detail later)</li><li>Code is made of simple, mechanical instructions</li><li>The computer runs the series of instructions</li><li>Computers do not have insight</li><li>Machine, following sequence of instructions</li><li>Question: if the computer is so mechanical...</li></ul><p><img src=\"https://introcomputing.org/code-1.png\" alt=\"computer running its simple instructions\"></p>But So Many Useful Features<ul><li>Think of all the useful computer features (phone, camera)<br>--Email, instant messaging<br>--MP3 audio<br>--Red-eye reduction</li><li>If computers are so stupid... why are they so useful?</li><li>What connects the two sides?</li></ul><p><img src=\"https://introcomputing.org/code-2.png\" alt=\"computer vs. red-eye reduction\"></p>Programmers Make It Happen<ul><li>Human programmer thinks of a useful feature<br>--Creativity, insight about problems, computers, ...</li><li>Programmer thinks through the solution</li><li>Breaking it down, directing the computer</li><li>Writing code for the computer</li><li>This is what computer programming is</li><li>Every useful feature you\'ve ever used has this pattern</li><li>Combine the best features of both sides: insight + inexpensive/fast</li><li>This diagram as course summary, visit the left side, coding</li></ul><p><img src=\"https://introcomputing.org/code-3.png\" alt=\"programmer writes code to implement their feature idea\"></p><p>Since the computer is totally mechanical and stupid -- how do they manage to do so many useful things? The gap between the computer and doing something useful is where the human programmer creates solutions. Programming is about a person using their insight about what would be useful and how it could be done, and breaking the steps down into code the computer can follow.</p><p><b>Code</b>&nbsp;refers to the language the computer can understand. For these lectures, we\'ll write and run short snippets of code to understand what the essential qualities of computers, and especially their strengths and limitations.</p><p>Experimenting with code, the nature of computers will come through very clearly ... powerful in their own way, but with a limited, mechanical quality. IMHO, this mixed nature of computers is something everyone should understand, to use them well, to not be intimidated by them.</p>Before Coding - Patience<ul><li>We\'ll start with some simple coding below</li><li>First code examples are not flashy</li><li>Code is like lego bricks... eventually make great combinations</li><li>But we have to start small</li></ul>Foreshadowing<p>Within a few hours of lecture, we\'ll be doing special effects with images such as the following:<br><img src=\"https://introcomputing.org/monkey.jpg\" alt=\"toy monkey\">&nbsp;<img src=\"https://introcomputing.org/moon.jpg\" alt=\"moon surface\">&nbsp;<img src=\"https://introcomputing.org/banana.jpg\" alt=\"banana\"></p><p>But for now we just have print()!</p><p><b>Patience</b>&nbsp;We\'re going to start by learning a few programming elements, and later we\'ll recombine these few elements to solve many problems. These first elements are simple, so they are not much to look at on their own. Be patient, soon we\'ll put these elements together -- like lego bricks -- to make pretty neat projects.</p>Javascript<ul><li>Javascript</li><li>Plus some extensions just for this class</li><li>Programs are small ... not professional Javascript</li><li>These are real programs</li></ul><p>For this class, we\'ll use a variant of the language known as \"Javascript\", with some added features for this course. The Javascript language works in the web browser, so all of our experiments can live right in the browser with nothing else required. We\'ll look at just the of Javascript needed for our experiments, not the full language one would see using Javascript professionally. That said, Javascript is a real language and our code is real code. Our small programs show the important features of code, while keeping things fast and small.</p>1. First Code Example - Print<p>Here is code which calls the \"print\" function. Click the Run button below, and your computer will run this code, and the output of the code will appear to the right.</p><br><p>6<br>1&nbsp;2<br></p><ul><li><b>Run</b>&nbsp;executes each line once, running from top to bottom</li><li><b>print</b>&nbsp;is a function -- like a verb in the code</li><li>Numbers within the parenthesis ( ... ) are passed in to the print function</li><li>Multiple values separated by commas</li><li><b>Experiments</b>&nbsp;change the code and run after each change see the new output:<br>--Change a number<br>--Add more numbers separated by commas inside the print(...)<br>--Copy the first line and paste it in twice after the last line<br>--I promise the output will get more interesting!</li><li><b>Syntax</b>&nbsp;the code is not free form<br>--Syntax is narrow, computer can only understand the code in this form<br>--A reflection of the inner, mechanical nature of the computer<br>--Don\'t be put off -- \"When in Rome...\"<br>--We\'re visiting the world of the computer</li><li>Note \"print\" is not a normal part of Javascript, just for this class</li></ul>2. Print String<br><p><br></p><ul><li>Plain numbers, e.g. 6</li><li>A&nbsp;<b>string</b>&nbsp;is a sequence of letters written within quotes to be used as data within the code<br>--e.g. \"hello\"<br>--Strings work with the print function, in addition to numbers<br>--Strings in the computer store text, such as urls or the text of paragraphs, etc.</li><li>A&nbsp;<b>comment</b>&nbsp;begins with // and extends through the end of the line. A way to write notes about the code, ignored by the computer.</li><li><b>Experiments:</b><br>--Edit the text within a string<br>--Add more strings separated by commas<br>--Add the string \"print\" -- inside of string is just data, not treated as code</li></ul><li>Note that&nbsp;<b>print</b>&nbsp;is recognized as a function in the code vs. the \"hello\" string which is just passive data (like verbs and nouns) The computer ignores the comments, so they are just a way for you to write notes to yourself about what the code is doing. Comments can be use it to temporarily remove a line of code -- \"commenting out\" the code, by placing a \"//\" to itsThinking About Syntax and Errors<ul><li>Syntax -- code is structured for the computer</li><li>Very common error -- type in code, with slight syntax problem</li><li>Professional programmers make that sort of \"error\" all the time</li><li>Fortunately, very easy to fix ... don\'t worry about it</li><li>Not a reflection of some author flaw</li><li>Just the nature of typing ideas into the mechanical computer language</li><li>Demo: a bunch of typical syntax errors + fixing them</li><li>Beginners can be derailed by syntax step</li><li>Do not be intimidated by these quick little errors</li></ul><p><b>Syntax</b>&nbsp;The syntax shown above must be rigidly followed or the code will not work: function name, parenthesis, each string has opening and closing quotes, commas separating values for a function call.</p><p>The rigidity of the syntax is a reflection of the limitations of computers .. their natural language is fixed and mechanical. This is important to absorb when working with computers, and I think this is where many people get derailed getting started with computers. You write something that any human could understand, but the computer can only understand the code where it fits the computer\'s mechanical syntax.</p><p>When writing for the computer, it is&nbsp;<b>very common</b>&nbsp;to make a trivial, superficial syntax mistakes in the code. The most expert programmers on earth make that sort of error all the time, and think nothing of it. The syntax errors do not reflect some flawed strategy by the author. It\'s just a natural step in translating our thoughts into the more mechanical language of the computer. As we\'ll see below, fixing these errors is very fast.</p><p>It\'s important to not be derailed by these little superficial-error cases. To help teach you the patterns, below we have many examples showing typical errors, so you can see what the error messages look like and see how to fix them. For each snippet of code below, what is the error? Sometimes the error message generated by the computer points to the problem accurately, but sometimes the error message just reveals that the error has so deeply confused the computer that it cannot create an accurate error message. Firefox currently produces the most helpful error messages often pointing to the specific line with problems.</p>Syntax Error Examples<p>These syntax problems are quick to fix.</p><br><p><br></p><br><p><br></p><br><p><br></p><br><p><br></p>Example Problem<p>Change the code below so, when run, it produces the following output:</p><pre>1 2 buckle\n3 4 knock\n</pre><br><p><br></p><p>For the example problems shown in lecture, the solutions are available as shown below. So you can revisit the problem, practice with it, and still see the solution if you like.</p></li>, questionStart=2021-02-21 11:04:37, questionEnd=2021-02-21 11:04:38, questionResult=无, questionResultType=1, questionCreateUser=1, createTime=Sun Feb 21 11:04:44 CST 2021, modifyTime=null, questionIsDelete=null, deleteTime=null, chapterName=null, createName=null)', '192.168.1.10', '2021-02-21 11:04:44', '内网IP|0|0|内网IP|内网IP');
