INSERT INTO `t_log` VALUES (1443, 'MrBird', '修改Question', 82, 'cc.mrbird.febs.exercise.controller.QuestionController.updateQuestion()', ' question: Question(questionId=22, chapterId=206, questionTitle=Bluescreen, questionContent=Bluescreen<p><br></p><p>Building on the earlier image manipulation and logic sections, here we see how to implement a movie special effect.<br></p>Bluescreen Special Effect<ul><li>\"Bluescreen\" video special effect</li><li>Video is just a series of still images, 20-60 per second</li><li>Have some background image, e.g. leaves.jpg</li><li>Detect colored area in an image, e.g. red in stop.jpg</li><li>For colored area, substitute in pixels from background image</li></ul><p>The stop.jpg image and the leaves.jpg image<br></p><p><img src=\"https://introcomputing.org/stop.jpg\" style=\"max-width:100%;\" width=\"30%\"><img src=\"https://introcomputing.org/leaves.jpg\" style=\"max-width: 100%;\" width=\"30%\"><br></p>Bluescreen Algorithm<p><img src=\"https://introcomputing.org/image-bluescreen.png\" style=\"max-width:100%;\"><br></p><ol><li style=\"text-align:left;\"><ul><li>Bluescreen algorithm</li><li>Two images:&nbsp;<b>image</b>&nbsp;and&nbsp;<b>back</b></li><li>Detect, say, red pixels in image</li><li>For each red pixel:</li><li>--Consider the pixel at the same x,y in back image</li><li>--Copy over the pixel from back to image</li><li>--What defines how a pixel looks? Three numbers.</li><li>--Copy over the red, green, and blue values</li><li>Result: red areas, substitute in areas from back image</li><li>Adjacent pixels maintained</li></ul>Bluescreen Example Code</li><li style=\"text-align:left;\">Two images: image and back\nif-statement / avg -- detects red as usual\nInside if:\n--1. Figure out x,y of pixel\n--2. Get pixel2 from back image (at x,y)\n--3. Make pixel the same as pixel2\n-- i.e. copy over red/green/blue values</li></ol><pre><code>image = new SimpleImage(\"stop.jpg\");\nback = new SimpleImage(\"leaves.jpg\");\n\nfor (pixel: image) {\n  avg = (pixel.getRed() + pixel.getGreen() + pixel.getBlue())/3;\n  if (pixel.getRed() &gt; avg * 1.5) {\n    x = pixel.getX();\n    y = pixel.getY();\n    pixel2 = back.getPixel(x, y);\n    pixel.setRed(pixel2.getRed());\n    pixel.setGreen(pixel2.getGreen());\n    pixel.setBlue(pixel2.getBlue());\n  }\n}\nprint(image);</code></pre>, questionStart=2021-02-24 20:34:02, questionEnd=2021-02-24 20:34:04, questionResult=<p>1</p><p>1 2</p><p>1 2 3</p>, questionResultType=1, questionCreateUser=null, createTime=null, modifyTime=Tue Mar 02 21:29:55 CST 2021, questionIsDelete=null, deleteTime=null, chapterName=null, createName=null, testPic=null, resultPic=null)', '127.0.0.1', '2021-03-02 21:29:56', '内网IP|0|0|内网IP|内网IP');
